CREATE DEFINER=`root`@`localhost` PROCEDURE `getTemperatureForYesterday`()
BEGIN
SELECT DATE_FORMAT(created_at, '%H:00') as created_at, geyser_temp, reservoir_temp 
FROM temperature_values 
WHERE created_at 
BETWEEN DATE_FORMAT(DATE_SUB(NOW(), INTERVAL 1 DAY), '%Y-%m-%d 00:00:00') 
AND DATE_FORMAT(DATE_SUB(NOW(), INTERVAL 1 DAY), '%Y-%m-%d 23:59:59') 
GROUP BY DATE_FORMAT(created_at, '%Y-%m-%d %k') 
ORDER BY id;
END ;;
