CREATE DEFINER=`root`@`localhost` PROCEDURE `incrementElementRuntime`()
BEGIN
DECLARE runtime TIME;
DECLARE incremented_runtime TIME;
SELECT element_runtime INTO runtime FROM system_config;
SET incremented_runtime = DATE_ADD(runtime, INTERVAL 1 SECOND);
UPDATE `geyser_pi`.`system_config` SET `element_runtime`= incremented_runtime WHERE `id`='0';
END ;;
